function Header() {

function movePage(page){
const target=document.getElementById(page);
target?.scrollIntoView({behavior:"smooth"});
}

  return (
    <div id="header">
      <div className="logo"></div>
      <div className="menu">
        <div className="menuContainer">
          <span onClick={movePage(home)}>Home</span>
          <span onClick={movePage(about)}>About</span>
          <span onClick={movePage(skill)}>Skill</span>
          <span onClick={movePage(experience)}>Experience</span>
          <span onClick={movePage(works)}>Works</span>
          <span onClick={movePage(contact)}>Contact</span>
        </div>
      </div>
    </div>
  );
}
export default Header;
